import React from 'react'
// import Challenge1 from './Challenge1'
// import ComA from './Pokemon API/ComA'
import { Route,Routes } from 'react-router-dom'
import About from './React Router/About'
import Contact from './React Router/Contact'
import Error from './React Router/Error'

const App = () => {
  return (
    <>
        {/* <Challenge1/> */}
        {/* <ComA/> */}
        {/* <About /> */}
        <Routes>
          <Route exact path='/' caseSensitive={false} element={<About/>}/>
          <Route exact caseSensitive={false} path='/contact' element={<Contact/>}/>
          <Route element={<Error/>} />
        </Routes>


    </>
  )
}

export default App
